import React from 'react';

const Product = () => {
  return (
    <div>
      <h1>Our Products</h1>
      <p>Here are some of our amazing products:</p>
      <ul>
        <li>Product 1</li>
        <li>Product 2</li>
        <li>Product 3</li>
      </ul>
    </div>
  );
};

export default Product;
